import { Route, Switch } from "react-router-dom";
import AddQuote from "./components/pages/AddQuote";
import AllQuote from "./components/pages/AllQuotes";
import QuoteDetail from "./components/pages/QuoteDetail";
function App() {
  return (
    <div>
      <Switch>
        <Route path="/add-quote">
          <AddQuote></AddQuote>
        </Route>
        <Route path="/all-quote">
          <AllQuote></AllQuote>
        </Route>
        <Route path="/quote-detail">
          <QuoteDetail></QuoteDetail>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
